import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent implements OnInit {
  title = 'friend list';
  listOfFriends = [];

  ngOnInit(): void {
    this.listOfFriends = [
      { id: 1, name: 'Carlo', age: 22, national: 'Ethiopia' },
      { id: 2, name: 'Mamdou', age: 21, national: 'Senegal' },
      { id: 3, name: 'Samule', age: 19, national: 'Nigeria' },
    ];
  }
}
<h1>{{ title }}</h1>
